import math

def extended_euclid(a, b):
    if b == 0:
        return a, 1, 0
    gcd, x1, y1 = extended_euclid(b, a%b)
    x = y1 
    y = x1 - ((a//b)*y1)
    return gcd, x, y

def inverse(a, N):
    gcd, x, y = extended_euclid(a, N)
    
    if gcd != 1:
        print("Error! Inverse does not exist.")
    
    return (x%N + N) % N


